const initState = [

  {
    id: 1,
    title: "مقدمة ابن خلدون ",
    author: "ابن خلدون ",
    isbn: "1289499030"
  },
  {
    id: 2,
    title: "الحاوي في الطب ",
    author: "ابو بكر الرازي ",
    isbn: "893847239479"
  }



]
const listItems = initState.map(book =>
  <li key={book.id}>
    {book.title}
    {book.author}

  </li>
)
export default function Profile() {
  return (
    <ul>
      {listItems}
    </ul>


  )
}

